using iTextSharp.text;
using iTextSharp.text.pdf;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;
using WebAppRfc.Dto;

namespace WebAppRfc.helper
{
    public class PDFFooter : PdfPageEventHelper
    {
        PersonaDto personaDto;

        public PDFFooter(PersonaDto personaDto)
        {
            this.personaDto = personaDto;
        }

        // write on top of document
        public override void OnOpenDocument(PdfWriter writer, Document document)
        {
            base.OnOpenDocument(writer, document);
            PdfPTable tabFot = new PdfPTable(new float[] { 1F });
            tabFot.SpacingAfter = 10F;
            PdfPCell cell;
            tabFot.TotalWidth = 300F;
            cell = new PdfPCell(new Phrase(""));
            cell.Border = Rectangle.NO_BORDER;
            tabFot.AddCell(cell);
            tabFot.WriteSelectedRows(0, -1, 150, document.Top, writer.DirectContent);
        }

        // write on start of each page
        public override void OnStartPage(PdfWriter writer, Document document)
        {
            base.OnStartPage(writer, document);
        }

        // write on end of each page
        public override void OnEndPage(PdfWriter writer, Document document)
        {
            BaseFont bf = BaseFont.CreateFont(BaseFont.TIMES_ROMAN, BaseFont.CP1252, BaseFont.NOT_EMBEDDED);
            iTextSharp.text.Font fuenteFooter01 = new iTextSharp.text.Font(bf, 8, iTextSharp.text.Font.NORMAL);
            iTextSharp.text.Font fuenteFooter02 = new iTextSharp.text.Font(bf, 12, iTextSharp.text.Font.NORMAL);

            DateTime fecha = DateTime.Now;

            base.OnEndPage(writer, document);
            PdfPTable tablaCuerpoDatosAutorizacion = new PdfPTable(2);
            float[] tablaCuerpoAutorizacion = new float[] { 1f, 3f };
            tablaCuerpoDatosAutorizacion.SetWidths(tablaCuerpoAutorizacion);
            tablaCuerpoDatosAutorizacion.TotalWidth = 550F;

            PdfPCell fechaDesicion = new PdfPCell(new Phrase("Cadena Original Sello:  Sello Digital:", fuenteFooter02));
            fechaDesicion.HorizontalAlignment = Element.ALIGN_LEFT;
            fechaDesicion.VerticalAlignment = Element.ALIGN_MIDDLE;
            fechaDesicion.UseAscender = true;
            fechaDesicion.Border = 0;
            tablaCuerpoDatosAutorizacion.AddCell(fechaDesicion);


            string dataFechaDesicion = $"||{fecha.ToString("yyyy/MM/dd")}||Autoservicio|Inscripción de Persona Física | {this.personaDto.Rtc}|2000001000007000112188|| AnYhM7rLjPtldSfQf9DJMAZuXon5KNRiqxVuYIO3wkpIu09BVxxQNBiLR42GfY5ahW1k95FtV2Vr5aZDV6/9KT5jE szRdDcYyfqcNUxkrRMeHhBy82trAIhilh5o6apCZhLH87jM6oSJmhzFjUOfhvXtbFNCQplaRwdMcUW5P8M=";
            PdfPCell varFechaDesicion = new PdfPCell(new Phrase(dataFechaDesicion, fuenteFooter01));
            varFechaDesicion.HorizontalAlignment = Element.ALIGN_LEFT;
            varFechaDesicion.VerticalAlignment = Element.ALIGN_MIDDLE;
            varFechaDesicion.UseAscender = true;
            varFechaDesicion.Border = 0;
            tablaCuerpoDatosAutorizacion.AddCell(varFechaDesicion);



            tablaCuerpoDatosAutorizacion.WriteSelectedRows(0, -1, 30, document.Bottom + 150, writer.DirectContent);


            PdfPTable tabFot = new PdfPTable(new float[] { 1F });
            PdfPCell cell;
            tabFot.TotalWidth = 550F;
            cell = new PdfPCell();
            //string base64 = @"";
            //iTextSharp.text.Image image = iTextSharp.text.Image.GetInstance(Convert.FromBase64String(base64));
            //cell.AddElement(image);
            string base64 = @"";
            iTextSharp.text.Image image = iTextSharp.text.Image.GetInstance(Convert.FromBase64String(base64));
            cell.AddElement(image);
            cell.Border = 0;
            cell.HorizontalAlignment = Element.ALIGN_CENTER;
            tabFot.AddCell(cell);
            tabFot.WriteSelectedRows(0, -1, 30, document.Bottom + 100, writer.DirectContent);
        }

        //write on close of document
        public override void OnCloseDocument(PdfWriter writer, Document document)
        {
            base.OnCloseDocument(writer, document);
        }
    }
}
